import react from 'react'

function Card(){

    let products = {
        "soda":[
            "pepsi",
            "coke",
            "7up",
            "sprite",
            "fanta",
            "mountain dew",
            "dr pepper",
            "root beer",
            "mug",

        ]
    }
    return(
        <div >
            <h2>Soda List</h2>
                {products.soda.map((soda, index) => (
            <div className='product-card' key={index}>{soda}</div>
         ))}
        </div>
    )
}


export default Card
